import React, { useState, useEffect } from 'react';
import { Menu, X, ChevronDown } from 'lucide-react';
import { motion, AnimatePresence } from 'framer-motion';
import { SERVICES } from '../constants';
import AICore from './AICore';

interface LayoutProps {
  children: React.ReactNode;
  onNavigate: (section: string) => void;
  onServiceSelect: (serviceId: string) => void;
  currentPage: string;
}

const Layout: React.FC<LayoutProps> = ({ children, onNavigate, onServiceSelect, currentPage }) => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [expandedMobileService, setExpandedMobileService] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navLinks = [
    { id: 'home', label: 'Home' },
    { id: 'services', label: 'Expertise', hasDropdown: true },
    { id: 'founders', label: 'Leadership' },
    { id: 'contact', label: 'Contact' },
  ];

  return (
    <div className="min-h-screen flex flex-col relative selection:bg-black selection:text-white overflow-hidden">
      {/* Global Ambient Background */}
      <div className="fixed inset-0 z-[-1] pointer-events-none">
        <div className="absolute top-[-10%] left-[-10%] w-[50%] h-[50%] bg-purple-100/40 rounded-full blur-[120px] animate-blob" />
        <div className="absolute top-[20%] right-[-10%] w-[40%] h-[60%] bg-blue-100/40 rounded-full blur-[120px] animate-blob animation-delay-2000" />
        <div className="absolute bottom-[-10%] left-[20%] w-[40%] h-[40%] bg-teal-100/30 rounded-full blur-[120px] animate-blob animation-delay-4000" />
      </div>

      {/* AI Animated Core */}
      <AICore />

      {/* Navigation */}
      <nav
        className={`fixed top-0 left-0 right-0 z-50 transition-all duration-500 border-b ${
          isScrolled 
            ? 'bg-white/60 backdrop-blur-xl border-white/20 shadow-sm py-3' 
            : 'bg-transparent border-transparent py-5'
        }`}
      >
        <div className="max-w-7xl mx-auto px-6 flex justify-between items-center">
          <div 
            className="cursor-pointer"
            onClick={() => onNavigate('home')}
          >
             {/* Logo Image - Make sure to save your logo as logo.png in the public folder */}
             <img src="data:image/png;base64," alt="ValueX Consulting" className="h-16 w-auto object-contain" />
          </div>

          {/* Desktop Nav */}
          <div className="hidden md:flex items-center space-x-8">
            {navLinks.map((link) => (
              <div key={link.id} className="relative group">
                <button
                  onClick={() => onNavigate(link.id)}
                  className={`text-sm font-medium transition-colors relative flex items-center gap-1 py-2 ${
                     currentPage === link.id ? 'text-black' : 'text-gray-500 hover:text-black'
                  }`}
                >
                  {link.label}
                  {link.hasDropdown && (
                    <ChevronDown size={14} className="mt-0.5 group-hover:rotate-180 transition-transform duration-200" />
                  )}
                  {currentPage === link.id && (
                    <motion.div layoutId="navIndicator" className="absolute bottom-0 left-0 right-0 h-0.5 bg-black rounded-full" />
                  )}
                </button>

                {/* Dropdown Menu */}
                {link.hasDropdown && (
                  <div className="absolute top-full left-1/2 -translate-x-1/2 pt-2 w-72 opacity-0 invisible group-hover:opacity-100 group-hover:visible transition-all duration-200 transform translate-y-2 group-hover:translate-y-0">
                    <div className="bg-white/80 backdrop-blur-2xl border border-white/20 shadow-xl rounded-2xl p-2 ring-1 ring-black/5 overflow-hidden">
                      {SERVICES.map((service) => (
                        <button
                          key={service.id}
                          onClick={(e) => {
                            e.stopPropagation();
                            onServiceSelect(service.id);
                            window.scrollTo({ top: 0, behavior: 'smooth' });
                          }}
                          className="block w-full text-left px-4 py-3 text-sm text-gray-600 hover:text-black hover:bg-white/60 rounded-xl transition-all duration-200"
                        >
                          {service.title}
                        </button>
                      ))}
                    </div>
                  </div>
                )}
              </div>
            ))}
            <button 
              onClick={() => onNavigate('contact')}
              className="bg-black/90 text-white px-5 py-2 rounded-full text-sm font-medium hover:bg-black transition-all transform hover:scale-105 shadow-lg hover:shadow-xl"
            >
              Get Started
            </button>
          </div>

          {/* Mobile Menu Button */}
          <button 
            className="md:hidden text-gray-800 p-2 rounded-lg hover:bg-black/5"
            onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
          >
            {mobileMenuOpen ? <X size={24} /> : <Menu size={24} />}
          </button>
        </div>
      </nav>

      {/* Mobile Menu Overlay */}
      <AnimatePresence>
        {mobileMenuOpen && (
          <motion.div
            initial={{ opacity: 0, backdropFilter: "blur(0px)" }}
            animate={{ opacity: 1, backdropFilter: "blur(12px)" }}
            exit={{ opacity: 0, backdropFilter: "blur(0px)" }}
            className="fixed inset-0 z-40 bg-white/90 pt-24 px-6 md:hidden overflow-y-auto"
          >
            <div className="flex flex-col space-y-6">
              {navLinks.map((link) => (
                <div key={link.id} className="flex flex-col items-center">
                  <button
                    onClick={() => {
                      if (link.hasDropdown) {
                        setExpandedMobileService(!expandedMobileService);
                      } else {
                        onNavigate(link.id);
                        setMobileMenuOpen(false);
                      }
                    }}
                    className="text-2xl font-medium text-gray-900 flex items-center gap-2"
                  >
                    {link.label}
                    {link.hasDropdown && <ChevronDown size={20} className={`transition-transform ${expandedMobileService ? 'rotate-180' : ''}`} />}
                  </button>
                  
                  {link.hasDropdown && expandedMobileService && (
                     <div className="mt-4 flex flex-col space-y-3 w-full max-w-xs">
                       {SERVICES.map((service) => (
                         <button
                           key={service.id}
                           onClick={() => {
                             onServiceSelect(service.id);
                             setMobileMenuOpen(false);
                             window.scrollTo({ top: 0, behavior: 'smooth' });
                           }}
                           className="py-2 text-gray-600 hover:text-black text-center text-lg"
                         >
                           {service.title}
                         </button>
                       ))}
                     </div>
                  )}
                </div>
              ))}
            </div>
          </motion.div>
        )}
      </AnimatePresence>

      <main className="flex-grow pt-20">
        {children}
      </main>

      {/* Footer */}
      <footer className="bg-white/40 backdrop-blur-md border-t border-white/20 py-16">
        <div className="max-w-7xl mx-auto px-6 grid grid-cols-1 md:grid-cols-4 gap-12">
          <div className="col-span-1 md:col-span-2">
            <h3 className="text-2xl font-bold tracking-tighter mb-4 flex items-center gap-2">
              <img src="data:image/png;base64," alt="ValueX" className="h-12 w-auto opacity-80" />
            </h3>
            <p className="text-gray-500 max-w-sm">
              AI-First Consulting. Helping organizations achieve cost reduction, assess processes, and deploy AI agents for automation.
            </p>
          </div>
          <div>
            <h4 className="font-semibold mb-4 text-gray-900">Services</h4>
            <ul className="space-y-2 text-sm text-gray-500">
              {SERVICES.map((service) => (
                <li 
                  key={service.id}
                  onClick={() => {
                    onServiceSelect(service.id);
                    window.scrollTo({ top: 0, behavior: 'smooth' });
                  }}
                  className="hover:text-black cursor-pointer transition-colors"
                >
                  {service.title}
                </li>
              ))}
            </ul>
          </div>
          <div>
            <h4 className="font-semibold mb-4 text-gray-900">Connect</h4>
            <ul className="space-y-2 text-sm text-gray-500">
              <li className="hover:text-black cursor-pointer">LinkedIn</li>
              <li className="hover:text-black cursor-pointer">Twitter</li>
              <li className="hover:text-black cursor-pointer">Email Us</li>
            </ul>
          </div>
        </div>
        <div className="max-w-7xl mx-auto px-6 mt-16 pt-8 border-t border-gray-200/50 text-center md:text-left text-xs text-gray-400">
           {new Date().getFullYear()} ValueX Consulting Firm. All rights reserved.
        </div>
      </footer>
    </div>
  );
};

export default Layout;